import React from 'react';
import Typography from '@mui/material/Typography';


type HeaderProps = {
    text: string;
};

const Header: React.FC<HeaderProps> = ({ text }) => {
    return (
        <Typography variant="h4" component="h4" style={{ marginLeft: '8px', marginRight:'8px' }}>
            {text}
        </Typography>
    );
};

export default Header;
